	__proto.onLoadFinish=function(){
		var gun=Laya.loader.getRes("Role/Role.lh");
		this.scene.addChild(gun);
		var water=Laya.loader.getRes("Role/water.lh");
		this.scene.addChild(water);
		gun.transform.rotate(new Vector3(0,50,0),false);
		var ani=gun.getChildAt(0).getComponent(Animator);
		ani.play("stand",0)
		var defaultState;
		defaultState=ani.getDefaultState(0);
		var nodes=defaultState._clip._nodes;
		var nodeOwners=defaultState._nodeOwners;
		for (var i=0,n=nodes.count;i < n;i++){
			var nodeOwner=nodeOwners[i];
			if(nodeOwner.fullPath=="Bip001/Bip001 Pelvis/Bip001 Spine/Bip001 Spine1.transform.localRotation"){
				ani.scriptRotationNodeIndex=i;
				break ;
			}
		};
		var angle=NaN;
		var angle2=NaN;
		var dir=0;
		var dir2=0;
		var deltaAngle=NaN;
		var deltaAngle2=NaN;
		angle=0;
		angle2=0;
		dir=-1;
		dir2=-1;
		deltaAngle=0.5;
		deltaAngle2=2;
		Laya.timer.loop(10,null,function(){
			angle=angle+deltaAngle*dir;
			angle2=angle2+deltaAngle2*dir2;
			if(angle <-30){
				dir=1;
				ani.play("stand",0);
			}
			if(angle > 50){
				ani.play("walk",0);
				dir=-1;
			}
			if(angle2 <-70){
				dir2=1;
				ani.play("attack",1);
			}
			if(angle2 > 70){
				dir2=-1;
				ani.play("huandanjia",1);
			}
			Quaternion.createFromYawPitchRoll(0,angle2*0.017 ,angle*0.017,ani.scriptRatation);
		})
		ani.play("kaiqiang",0)
		console.log("LoadResCompleted");
	}

